private String str(List<Token> lst) {
  StringBuilder sb = new StringBuilder();
  sb.append('{');
  for (Token t : lst) {
    sb.append('(');
    sb.append('"');
    sb.append(t.termText());
    sb.append("\",increment=");
    sb.append(Integer.toString(t.getPositionIncrement()));
    sb.append(')');

    sb.append(',');
  }
  sb.append('}');
  return sb.toString();
}

